import React from "react";
//nodejs library that concatenates classes
import withStyles from "@material-ui/core/styles/withStyles";


import ImageGridList from "assets/jss/material-kit-react/views/landingPageSections/imageGridList.jsx";


class PortofolioSection extends React.Component {
	render() {
		const { classes } = this.props;
		return(
			<div className={classes.container}>
				<h1>Testing!!!</h1>
			</div>
		);
	}
}

export default withStyles(ImageGridList)(PortofolioSection);
